import React from "react";
import { useState } from "react";
class Header extends React.Component {
    constructor()
    {
        super();
        this.state.name = "abcd";
    }
    render() {
      return (
        <div>
            <label>
            Name:
            <input type="text" value={this.state.name} />
            </label>
            <input type="submit" value="Submit" />
        </div>
      );
    }
  }
  
  export default Header;
